import React from 'react';
import { Navbar, Nav, NavItem, NavDropdown, Button , Form , FormControl} from 'react-bootstrap';


const Footer = () => {

    return (
        <Navbar bg="dark" expand="lg">
             <Navbar.Brand href="/">Homepage</Navbar.Brand>
             </Navbar>
    );

};

export default Footer;
